import React, { useRef } from "react";
import { StyleSheet, View, SafeAreaView, Dimensions } from "react-native";
import { AntDesign } from "@expo/vector-icons";

import { WebView } from "react-native-webview";


export default function TabOneScreen() {
  const webViewRef = useRef(null)

  const goback = () => {
    webViewRef.current.goBack();
  };

  const goforward = () => {
    webViewRef.current.goForward();
  };

  const refresh = () => {
    webViewRef.current.reload();
  };


  return (
    <SafeAreaView style={styles.childview}>

      <View style={styles.navbar}>

      <View style={styles.refresh}>
          <AntDesign name="reload1" size={25} color="grey" onPress={refresh} />
        </View>
        <View style={styles.forward}>
          <AntDesign name="right" size={25} color="grey" onPress={goforward} />
        </View>
        <View style={styles.back}>
          <AntDesign name="left" size={25} color="grey" onPress={goback} />
        </View>


      </View>
      <WebView ref={webViewRef} source={{ uri: "https://wakeid2.wcpss.net/" }} /> 
    </SafeAreaView>
  );
}

